import * as React from "react";
import {
  Box,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
  Button,
  Stack,
  Grid,
  Container,
} from "@mui/material";
import { useState } from "react";
import Dropzone from "react-dropzone";
import md5 from "md5";
import { Theme } from "../others/Theme";
import folder from "../others/folder.png";

export const CreateProduct = () => {
  const [name, setName] = useState();
  const [file, setFile] = useState();
  const [blockchain, setBlockchain] = useState();
  const [itemTag, setItemTag] = useState();
  const [externalLink, setExternalLink] = useState();
  const [quantity, setQuantity] = useState();
  const [ItemObject, setItemObject] = useState();
  const [description, setDescription] = useState();

  const addItem = (event) => {
    event.preventDefault();
    setItemObject({
      name,
      id: md5(name),
      file,
      blockchain,
      tag: itemTag,
      externalLink,
      quantity,
      description,
    });
  };
  console.log(ItemObject);

  return (
    <>
      <Container maxWidth="sm">
        <Dropzone onDrop={(file) => setFile(file)}>
          {({ getRootProps, getInputProps }) => (
            <Box
              sx={{
                bgcolor: Theme.palette.primary.light,
                boxShadow: 1,
                borderRadius: 5,
                p: 2,
                m: 1,
                mt: 3,
                ml: 2,
                mr: 2,
                mb: 2,
                pb: 8,
              }}
              {...getRootProps()}
            >
              <Box sx={{ }}>
                <section style={{ height: "10rem" }}>
                  <div>
                    <input {...getInputProps()} />
                    <Typography align="center">
                      <img src={folder} height={50} width={50} />
                    </Typography>
                    <Typography align="center">
                      Drag 'n' drop some files here, or click to select files
                    </Typography>
                  </div>
                </section>
              </Box>
            </Box>
          )}
        </Dropzone>
        <Box sx={{ width: "100%", ml: 2 }}>
          <Stack direction="row" spacing={2}>
            <Grid container spacing={3} sx={{ maxWidth: "50%" }}>
              <Grid xs>
                <Box
                  sx={{
                    bgcolor: "#EBDEF0",
                    boxShadow: 1,
                    borderRadius: 5,
                    p: 2,
                    m: 3,
                  }}
                >
                  <TextField
                    label="Name"
                    error={!name && "Name is empty"}
                    helperText={!name && "Please"}
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                  />
                </Box>
              </Grid>
              <Grid xs>
                <Box
                  sx={{
                    bgcolor: "#FCF3CF",
                    boxShadow: 1,
                    borderRadius: 5,
                    p: 2,
                    m: 3,
                  }}
                >
                  <TextField
                    label="External Link"
                    value={externalLink}
                    onChange={(e) => setExternalLink(e.target.value)}
                  />
                </Box>
              </Grid>
              <Grid>
                <Box
                  sx={{
                    bgcolor: "#EBDEF0",
                    boxShadow: 1,
                    borderRadius: 5,
                    p: 2,
                    m: 3,
                  }}
                >
                  <TextField
                    label="Quantity"
                    value={quantity}
                    onChange={(e) => setQuantity(e.target.value)}
                  />
                </Box>
              </Grid>
            </Grid>

            <Grid container spacing={3} sx={{ maxWidth: "50%" }}>
              <Grid xs={14} md={9}>
                <Box
                  sx={{
                    bgcolor: "#FCF3CF",
                    boxShadow: 1,
                    borderRadius: 5,
                    p: 2,
                    maxWidth: "max",
                  }}
                >
                  <Typography>select blockchain</Typography>
                  <FormControl sx={{ m: 1, minWidth: 120 }}>
                    <InputLabel>blockchain</InputLabel>
                    <Select
                      value={blockchain}
                      label="Tag"
                      onChange={(e) => setBlockchain(e.target.value)}
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      <MenuItem value={1}>blockchain1</MenuItem>
                      <MenuItem value={2}>blockchain2</MenuItem>
                      <MenuItem value={3}>blockchain3</MenuItem>
                    </Select>
                  </FormControl>
                </Box>
              </Grid>
              <Grid xs={14} md={9}>
                <Box
                  sx={{
                    bgcolor: "#EBDEF0",
                    boxShadow: 1,
                    borderRadius: 5,
                    p: 2,
                  }}
                >
                  <Typography>select tagðŸ˜ˆ</Typography>
                  <FormControl sx={{ m: 1, minWidth: 120 }}>
                    <InputLabel>Tag</InputLabel>
                    <Select
                      value={itemTag}
                      label="Tag"
                      onChange={(e) => setItemTag(e.target.value)}
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      <MenuItem value={1}>Art</MenuItem>
                      <MenuItem value={2}>Music</MenuItem>
                      <MenuItem value={3}>Photo</MenuItem>
                    </Select>
                  </FormControl>
                </Box>
              </Grid>
            </Grid>
          </Stack>
        </Box>
        <Box
          sx={{
            bgcolor: "#FCF3CF",
            boxShadow: 1,
            borderRadius: 5,
            p: 3,
            m: 3,
          }}
        >
          <TextField
            label="Description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
        </Box>
        <Box>
          <Button
            sx={{
              backgroundColor: Theme.palette.primary.light,
              color: "#888",
              "&:hover": {
                backgroundColor: Theme.palette.primary.main,
              },
            }}
            variant="contained"
            onClick={addItem}
          >
            create
          </Button>
        </Box>
      </Container>
    </>
  );
};
